import React, { useState } from "react";
import { TextField, Grid, Button, withStyles, makeStyles } from "@material-ui/core";
import { sendSignUpInfo } from "../api/generalClient";

const StyledButton = withStyles((theme) => ({
  root: {
    backgroundColor: theme.palette.secondary.main,
    color: "white",
    width: "30%",
    alignSelf: "center",
    zIndex: theme.zIndex.drawer + 2,
  },
  label: {
    textTransform: "capitalize",
  },
}))(Button);

export default function LoginForm() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [pass, setPass] = useState("");


  const onChange_name = (e) => {
    e.preventDefault();
    setName(e.target.value);
  }

  const onChange_email = (e) => {
    e.preventDefault();
    setEmail(e.target.value);
  }

  const onChange_password = (e) => {
    e.preventDefault();
    setPass(e.target.value);
  }

  const sendSignUpInfo = (e) => {
    e.preventDefault();
    console.log( email);
    try {
      e.preventDefault();
      LoginAPIMethod({ name:name, email: email, password: pass }, (res)=> {console.log(res)});
    }
    catch (err) {
      alert(err.response);
    }
  }

  return (
    <>
      <form>

      <Grid item>
          <TextField label="Name" onChange={onChange_name}/>
        </Grid>
        <Grid item>
          <TextField label="Email" value={email} onChange={onChange_email}/>
        </Grid>
        <Grid item>
          <TextField label="Password" value={pass} onChange={onChange_password}/>
        </Grid>
        <StyledButton variant="contained" style={{ margin: "16px" }} onClick={sendLoginInfo} >
          Login
        </StyledButton>
      </form>
    </>
  );
}
